description:
Out of print Asian Man Records release.

Besides this EP, the only other release by this band was &quot;Freewheelin'&quot;
That album is not out of print and is available for purchase: &lt;a href=&quot;
http://asianmanrecords.com/bands/tuesday/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://asianmanrecords.com/bands/tuesday/&lt;/a&gt;

This is one of many CDs I ripped for posterity a while back.
I went through many phases when it came to rip/encode/split methods.
This one was made before I documented the rip, encode, and split.
The tag comment shows that I used BonkEnc (now fre:ac).  This was the first ripper/encoder I messed with. The offset of my CDROM was not applied for the rip.

I used CUETools to apply the proper offset, verify each file, and generate an AccurateRip/CTDB log. This log is included.

I'm new to this.  Please comment and tell me if I'm doing anything right or wrong.  Thanks!
